curl -XPOST 'http://localhost:9200/electronic_products/_create/9497' -H 'Content-Type: application/json' -d '{"product_name": "SGM8931/SGM8932", "table_name": "GENERAL DESCRIPTION", "content": "GENERAL DESCRIPTION  The SGM8931/2/3/4 are a family of single, dual and  quad operational amplifiers designed for 5V operation.  These devices can operate from 1.8V to 5.5V single  supply. They provide a wide input common mode  voltage range and rail-to-rail output voltage swing.  The SGM8931/2/3/4 provide excellent overall performance.  They feature low offset, low noise and low distortion.  These devices work well in low voltage or battery-  powered audio systems requiring high quality.  The SGM8931 is available in Green SOT-23-5, SC70-5,  SOIC-8 and MSOP-8 packages. The SGM8932 is  available in Green SOIC-8 and MSOP-8 packages. The  SGM8933 is available in Green SOT-23-6, SOIC-8 and  MSOP-8 packages. The SGM8934 is available in  Green SOIC-14 and TSSOP-14 packages. They are  specified over the -40℃ to +85℃ temperature range.  "}'
